import { useEffect, useState } from 'react';
import axios from 'axios';
import './login.css';

const Login = ({login})=>{

    const [l, setLogin] = useState(false);

    const loginProcess = ()=> setLogin(true);

    useEffect(()=>{
        const e = document.querySelector("#email");
        const p = document.querySelector("#password");
        axios({
            method: "post",
            url : "/login",
            headers : {},
            data : {
                email : `${e.innerText}`,
                password : `${p.innerHTML}`
            }
        })
    },[l])

    if(login){
        return(
            <div className="login px-5">
                <input type="text" className="my-2 py-2" placeholder="Email" id="email"/>
                <input type="password" placeholder="Password" id="password"/>
                <button className="my-2 btn btn-outline-dark btn-bg" onClick={loginProcess}>Login</button>
                <div>
                    <span>New to us - </span>
                    <a href="">Create an Account</a>
                </div>
            </div>
        );
    }
    return(
        <></>
    );
}

export default Login;
